  position: 'absolute',
  fontSize:20,
  color:'#FFF',
  display: 'inlineBlock'

};
class App extends Component {
  render() {
    return (
      <div className=" App" style={black_div} >
     <div>
       hiiiiiii
     </div>
     <div>
       hello
     </div>
      </div>
    );
  }
}

export default App;
